/**
 * Customer Dto
 * Data Transfer Object for customer
 * used for rest api message sent to back end
 *
 *
 */
export class CustomerDto {
  constructor(id, firstName, lastName, address, postal_code, phone) {
    this.id = id;
    this.firstName = firstName;
    this.lastName = lastName;
    this.address = address;
    this.postal_code = postal_code;
    this.phone = phone;
  } // set id


  setId(idIn) {
    this.id = idIn;
  } // get id


  getId() {
    return this.id;
  } // set first name


  setFirstName(nameIn) {
    this.firstName = nameIn;
  } // get first name


  getFirstName() {
    return this.firstName;
  } // set last name


  setLastName(nameIn) {
    this.lastName = nameIn;
  } // get last name


  getLastName() {
    return this.lastName;
  } // set address


  setAddress(addressIn) {
    this.address = addressIn;
  } // get address


  getAddress() {
    return this.address;
  } // set postal code


  setPostalCode(postalIn) {
    this.postal_code = postalIn;
  } // get postal code


  getPostalCode() {
    return this.postal_code;
  } // set phone


  setPhone(phoneIn) {
    this.phone = phoneIn;
  } // get phone


  getPhone() {
    return this.phone;
  }

}
